    [],nt"revision_timestamp": "2015-05-07T01:02:06.601657",nt"name": "nitrous-oxide-liquid-injection-thrust-vector-control-system-testing-project",nt"isopen":
    true,nt"url": null,nt"notes": "A Nitrous Oxide-fed Liquid Thrust Vector
    Control system is proposed as an efficient method for vehicle attitude control during
    powered flight. Pulled from a N2O main propulsion system oxidizer tank, it features
    system simplicity, no toxicity, room temperature storability, high system mass fraction
    and superior performance due to its exothermic decomposition characteristics, answering
    the need for innovative attitude control technologies.  A continuing series of 1,000
    lb thrust hybrid rocket motor tests are proposed to characterize N2O's Side Specific
    Impulse as a function of thrust vectoring angle, as well as a series of 4,000 lb
    thrust motor firings culminating in a closed-loop Guidance Navigation and Control
    Hardware-In-The-Loop test in a vertical stand. At the conclusion of Phase 2, the
    technology will be ready for development into an upper stage as an integrated main
    propulsion Thrust Vector Control (TVC) /Attitude Control System for a small launch
    vehicle, or as a separate TVC system for any solid, liquid or hybrid powered vehicle.
